import '../design/lista.css';
import React from "react";
import UseSWR from "swr";
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

var da = [];
function returnDados() {
   const url = "http://localhost:3001/dados";
   fetch(url)
      .then(response => response.json())
      .then(dados => {
         return dados.map(function (dado) {
            da.push(dado)

         })
      })
};
const dado = returnDados();
console.log(da)


const Home = () => {
   const { data, mutate } = UseSWR("https://pokeapi.co/api/v2/pokemon/ditto")
   console.log(JSON)
   return (<pre>aa{data}</pre>,<br/>,<button onChange={console.log(data),()=>mutate()}>muda</button>)
}
const Outra = () => {
   return <h2>aloo</h2>
}
function lista() {
   return (
      <div className="appLista">
         <header className="appBarLista">
            <ul className="listLista">
               <li className="elemlistLista"><a href="/">Graficos</a></li>
               <li className="elemlistLista" id="elemlistListaDois"><a href="/cliente">Cadastrar Novos Usuarios</a></li>
               <li className="elemlistLista"><a href="/lucros">Lucros</a></li>/
            </ul>
         </header>
         <main className="mainLista">
            <div className="lista">
               <Router>
               <Link to="/">Home</Link>
                  <Link to="/outra">Outra</Link>
                  <Route exact path="/" component={Home} />
                  <Route path="/outra" component={Outra} />
               </Router>
            </div>
         </main>

      </div>
   )
}


export default lista;






